import {
    CHANGE_SEARCH_FIELD,
    CHANGE_SEARCH_ROBOTS_SUCCESS,
    CHANGE_SEARCH_ROBOTS_PENDING,
    CHANGE_SEARCH_ROBOTS_FAILED
} from "./Constants";

export const setSearchField = (text) => ({
        type: CHANGE_SEARCH_FIELD,
        payload: text
    }
)
